export const InviteIcon = () => (
  <div style={{ marginLeft: '2px' }}>
    <svg     cursor='pointer' width='28' height='28' viewBox='0 0 28 28' fill='none' xmlns='http://www.w3.org/2000/svg'>
      <path
        fill='#1D9D67'
      />
    </svg>
  </div>
);
